import { Component } from '@angular/core';

@Component({
  selector: 'app-exercicio01',
  templateUrl: './exercicio01.component.html',
  styleUrls: ['./exercicio01.component.css']
})
export class Exercicio01Component {
  musica: string = 'Baby Queen';
  album: string = 'Cracker Island(Deluxe)';
  interprete: string = 'Gorillaz';
}
<div>
  <h2>Exercício 01</h2>
  <strong>Música: </strong> {{ musica }}<br>
  <strong>Álbum: </strong> {{ album }}<br>
  <strong>Intérprete: </strong> {{ interprete }}<br>
</div>
